"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Groin (inguinal) hernias in children (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/groin-inguinal-hernias-in-children-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H13447739\">",
"      <span class=\"h1\">",
"       What is a groin (inguinal) hernia?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A groin hernia (also called an &ldquo;inguinal hernia&rdquo;) is a bulge in the part of the body where the thigh meets the trunk (",
"      <a class=\"graphic graphic_figure graphicRef64249 \" href=\"mobipreview.htm?41/62/42976\">",
"       figure 1",
"      </a>",
"      ). In boys, the bulge can extend into the scrotum, the sac that holds the testicles. In girls, the bulge can extend into the outer lips of the vagina.",
"     </p>",
"     <p>",
"      Normally, organs in the belly are held in place by a wall of muscle. Groin hernias happen when a piece of intestine or other organ in the belly pushes out through that wall of muscle. Groin hernias are common in babies, because babies have a hole in the muscle wall that normally closes soon after birth. But if the hole does not close, or if the baby is born early, a hernia can happen.",
"     </p>",
"     <p>",
"      Groin hernias can be dangerous if a piece of intestine gets trapped in the hernia and can&rsquo;t slide back into the belly. Doctors call this an &ldquo;incarcerated&rdquo; hernia. When this happens, the intestine does not get enough blood, so it can become swollen and damaged.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13447754\">",
"      <span class=\"h1\">",
"       What are the symptoms of a groin hernia in children?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The main symptom of a groin hernia is a bulge in the groin that comes and goes. It often appears when the child has been crying or straining and then goes away when the child is resting. The child might also be fussy and not eat well.",
"     </p>",
"     <p>",
"      If the intestine gets trapped, the bulge in the groin does not go away. In that case, the hernia might feel firm. Other symptoms of trapped intestines might include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Crying",
"       </li>",
"       <li>",
"        Vomiting",
"       </li>",
"       <li>",
"        Swollen belly",
"       </li>",
"       <li>",
"        The bulging area turns red or blue",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13447769\">",
"      <span class=\"h1\">",
"       Should I see a doctor or nurse?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. If your child has bulge in the groin that comes and goes, see your child&rsquo;s doctor or nurse. Groin hernias in children almost always need to be treated.",
"     </p>",
"     <p>",
"      If your child has a bulge in the groin that does not go away, see your doctor or nurse right away. This is an emergency!",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13447784\">",
"      <span class=\"h1\">",
"       Will my child need tests?",
"      </span>",
"      &nbsp;&mdash;&nbsp;That depends on whether you have a boy or a girl.",
"     </p>",
"     <p>",
"      In boys, tests are not usually needed. Doctors can usually tell if a boy has a hernia by learning about his symptoms and doing an exam. In some cases, the doctor might also do an ultrasound to see if the bulge is a hernia or if there is another cause for the swelling.",
"     </p>",
"     <p>",
"      In girls, the doctor will usually do an ultrasound to see if the ovary is trapped in the hernia.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13447799\">",
"      <span class=\"h1\">",
"       How are hernias treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Almost all children who have hernias need to have surgery. Doctors usually do surgery soon after the hernia is found to keep the intestines from getting trapped. A special doctor called a &ldquo;surgeon&rdquo; will do the surgery on your child.",
"     </p>",
"     <p>",
"      Surgeons can repair groin hernias with surgery in 1 of 2 ways. Your child&rsquo;s doctor will decide which way is best for your child. The 2 types of surgery are:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Open surgery&nbsp;&ndash; During an open surgery, the surgeon makes a small cut near the hernia. Then he or she gently pushes the bulging tissue back into place. Next, the surgeon sews the muscle layer together so that nothing can bulge through.",
"       </li>",
"       <li>",
"        Laparoscopic surgery&nbsp;&ndash; During laparoscopic surgery, the surgeon makes a few cuts that are much smaller than the ones used in open surgery. Then he or she puts long thin tools into the area near the hernia. One of the tools has a camera on the end, which sends pictures to a TV screen. This tool is called a &ldquo;laparoscope.&rdquo; The surgeon can look at the picture on the screen to guide his or her movements. Then the surgeon uses the long tools to fix the muscle layer with stitches.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If the intestines get trapped, the doctor will first try to &ldquo;reduce&rdquo; the hernia, which means gently pushing it back into the belly. If this works, a surgeon will do surgery to fix the hernia within a few days. If the doctor is not able to reduce the hernia, emergency surgery might be needed.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13447814\">",
"      <span class=\"h1\">",
"       More on this topic",
"      </span>",
"     </p>",
"     <p>",
"      <a class=\"medical medical_basics\" href=\"mobipreview.htm?41/62/42977?source=see_link\">",
"       Patient information: Inguinal and femoral (groin) hernias (The Basics)",
"      </a>",
"     </p>",
