" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Needle aspiration of an auricular hematoma",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 297px; height: 618px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    After cleansing and provision of local anesthesia, the most flucutant part of the hematoma is identified and aspirated using an 18 gauge needle while simultaneously milking the hematoma to ensure complete drainage (top figure) OR, for large hematomas or those that are over 24 hours but less than seven days old, incise along the curvature of the auricle at the base of the hematoma and use curved hemostats to completely evacuate the hematoma and any clots (bottom figure).",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
