var title_f41_44_42693="Apical 4 chamber color Doppler diastole";
var content_f41_44_42693=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=CARD%2F54278%7ECARD%2F68049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=CARD%2F54278%7ECARD%2F68049&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Apical four chamber view with color flow Doppler during diastole",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 369px; height: 288px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Shown is the apical four chamber view with color flow Doppler during diastole. There is physiolgic flow (tagged red) into the left ventricle (LV) that extends from the right superior pulmonary veins (RSPV) to the apex of the LV. This color signal is used to position a pulsed wave Doppler sample volume so that quantitatable signals of flow can be obtained from the pulmonary veins and from the mitral leaflet tips.",
"    <div class=\"footnotes\">",
"     RA: right atrium; RV: right ventricle.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Apical four chamber view with color flow Doppler during systole",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 294px; height: 229px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    The apical four chamber view with color flow Doppler was obtained from a normal subject during systole. The systolic flow signal is shown in blue, ie, flow is moving away from the transducer. This signal is used to position a pulsed wave Doppler sample volume in the left ventricular outflow tract (LVOT) so that flow characteristics can be quantitated.",
"    <div class=\"footnotes\">",
"     LV: left ventricle.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
