"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?8/15/8442?source=related_link\">",
"      Sexual activity in patients with heart disease",
"     </a>",
"    </li>",
"    <li class=\"plainItem\">",
"     <a class=\"medical medical_review\" href=\"mobipreview.htm?1/63/2039?source=related_link\">",
"      Sexual dysfunction associated with selective serotonin reuptake inhibitor (SSRI) antidepressants",
"     </a>",
"    </li>",
