var title_f41_44_42699="Suggestion therapy for habit cough";
var content_f41_44_42699=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F58800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F58800&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Major elements of a 15-minute suggestion-therapy session for habit-cough syndrome",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td>",
"       &bull; Expressing confidence, communicated verbally and behaviorally, that the therapist will be able to show the patient how to stop the cough",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Explaining the cough as a vicious cycle of an initial irritant, now gone, that had set up a pattern of coughing that caused irritation and additional symptoms",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Encouraging the suppression of cough to break the cycle (the therapist closely observes the patient for initiation of the muscular movement that precedes coughing and immediately exhorts the patient to hold the cough back, emphasizing that each second the cough is delayed makes further inhibition of cough easier)",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Offering an alternative behavior to coughing in the form of inhaling a generated mist or sipping bodytemperature water with encouragement to inhale the mist or sip the water every time the patient begins to feel the urge to cough",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Repeating expressions of confidence that the patient is developing the ability to resist the urge to cough",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; When some ability to suppress cough is observed (usually after &sim;10 min), asking in a rhetorical manner if the patient is beginning to feel that he or she can resist the urge to cough (eg, \"You are beginning to feel that you can resist the urge to cough, aren't you?\")",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       &bull; Discontinuing the session when the patient can repeatedly answer positively to the question, \"Do you feel that you can now resist the urge to cough on your own?\" (this question is only asked after the patient has gone 5 minutes without coughing)",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Lokshin B, Lindgren S, Weinberger M, Koviach J. Outcome of habit cough in children treated with a brief session of suggestion therapy. Annals of Asthma, Allergy, and Immunology 1991; 67:579. Copyright &copy;1991 American College of Allergy, Asthma and Immunology.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
